    return(
      <div className={{with: "20%", display: 'inline-block'}}>
        <h2 style={{color: selectedTextColor}}>
          Number Text
        </h2>
      </div>
    );
  }
}

class Filter extends Component
{
  render()
  {
    return(
      <div style={{color: selectedTextColor}}>
        <img/>
          <input type="text"/>
      </div>
    )
  }
}


class Playlsit extends Component
{
  render()
  {
    return(
    <div style={{color: selectedTextColor}}>
      <img/>
      <h3>
        Playlist Name
