        <li>
          Song 2
        </li>
        <li>
          Song 3
        </li>
      </ul>
    </div>);
  }
}

class App extends Component 
{
  render() 
  { 
    return (
      <div className="App">
        <h1>
          Title
        </h1>

        <Aggregate />

